import React from 'react'
import { Link } from 'react-router-dom'

const Navbar = () => {

  return (
    <nav>
       <Link to="/home">Home</Link>
       <Link to="/favs">Favs</Link>
       <Link to="/contact">Contact</Link> 
       
      <button onClick={handle}>Change theme</button>
    </nav>
  )
}

export default Navbar
